import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';
import Knob from './childComponents/volumeSl';

ReactDOM.render(<Knob />, document.getElementById('root'));

serviceWorker.unregister();
